(6, '太平洋学生幼儿综合意外保险', 'plan', 1, '专业的境外旅游保险，所有国家均可承保。涵盖旅行意外、旅程阻碍、财务保障、紧急医疗和责任保障，全方位为您的旅途保驾护航。', 4, '中国太平洋财产保险股份有限公司北京分公司', 3, '非投资型家财险', '0.00', '0.00', '0.00', '年满60天即可承保，无最高年龄限制无除外国家限制', '1、被保险人的投保年龄为出生满60天以上。按中国保监会规定，18周岁以下的未成年人身故保险金额以10万元为限。71周岁及以上的被保险人，其身故保险金额为上表所载金额的一半。\r\n2、若被保险人为同一旅行自愿投保由本保险公司承保的多种综合保险（不包括团体保险），且在不同保障产品中有相同保障利益的，则本保险公司仅按其中保险金额最高者做出赔偿。\r\n3、承保在全球旅行期间的风险。如保险期间为一年，每次承保旅程最长期限为183天。如因死亡、身体伤害、疾病、或公共交通延误，保障自动顺延至行程结束。\r\n       根据国家旅游局的相关声明，因近期伊拉克和越南局势不稳，因此安联保险所属境外险产品暂时不承保前往这两个国家的游客。\r\n        同时，由于国家旅游局未发布有关泰国的预警，因此前往泰国的游客仍在保障范围内。如有前往泰国的游客，因担忧局势问题取消行程的，不能适用于安联境外险产品的“旅程取消保障”。特此通知。', '', 1, 'admin', 1406175455, 1406633792),
(7, '平安少儿保险卡A卡', 'product', 1, '提供意外伤害及医疗保障，特别新增5万元重大疾病保障，另有意外住院护理津贴\r\n购买便捷，激活简单，全国通赔。', 7, '中国平安财产保险股份有限公司', 31, '意外伤害保险', '30.00', '5.00', '1.00', '', '', '', 1, 'admin', 1406294670, 1406629341),
(8, '平安少儿保险卡B卡', 'product', 1, '', 7, '中国平安财产保险股份有限公司', 31, '意外伤害保险', '12.00', '3.00', '1.00', '', '', '', 1, 'admin', 1406295237, 1406443406),
(9, '平安少儿保险卡C卡', 'product', 1, '', 7, '中国平安财产保险股份有限公司', 31, '意外伤害保险', '0.00', '0.00', '0.00', '', '', '', 1, 'admin', 1406295254, 1406295254),
