('4028810d42d8a5550142d8ca7800003a', 'Z0', '中天信合保险代理（北京）有限公司', '中天总部', '4028810c431fff770143201228b10003', '北京市西城区新外大街8号金丰和综合楼101室', '北京市西城区新外大街8号金丰和综合楼101室', '', '010-82089071', '', '100088', '', '', '', '', 1, NULL, '中天信合保险代理（北京）有限公司是中国保险监督管理委员会批准成立的全国资质保险专业代理公司，从2008年开始就致力于财产险业务和健康保险代理业务。成立初期以非车险业务为主，逐渐向车险和寿险领域拓展。2012年公司注册资本金增至5000万；成为全国专业代理资质。代理销售的保险产品，适应社会各界企事业单位的需要，深受公众的欢迎。 代理销售的保险产品在佣金方面有绝对的优势，能满足代理人伙伴的展业需要！在代理的险种方面做到了多元化！报价快捷、投保灵活！公司拥有专业的非车险业务管理服务团队，拥有网络远程出单权限，服务体系完善，售前售后服务与保险公司建立战略合作！', 0, 0, 0, '00000000000000000000000000000000', '2013-12-10 03:16:56', '2014-03-24 00:14:55', ''),
